import Link from 'next/link';

const LinkStyle = {
    color: 'orange', 
                  borderLeft: '5px solid black',
                  padding: '5px'
}

const About = () => (
    <div>
        <h2>About page</h2>
        <Link href='/'>
            <a 
              style={{ 
                  color: 'orange', 
                  borderLeft: '5px solid black',
                  padding: '5px'
                  }}>home</a>
        </Link>
    </div>
)

export default About;
